import React from 'react';

const TodoList = ({ items }) => {
	return (
		<div className="mt-5">
			<ul className="list-group">
                {items.map((item) =>
                    <div>
						<li key={item} className="list-group-item">
							{item}
							<a href='#'>Delte</a>
						</li>
					</div>
                )}
            </ul>
		</div>
	);
};

export default TodoList;
